// App.js
import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Update the import for BrowserRouter and Route
import { Routes, Link } from 'react-router-dom'; // Import Routes from react-router-dom

import BotCollection from './BotCollection';
import YourBotArmy from './YourBotArmy';
import BotSpecs from './BotSpecs';

const App = () => {
  return (
    <Router>
      <nav>
        <ul>
          <li>
            <Link to="/">Bot Collection</Link>
          </li>
          <li>
            <Link to="/yourbotarmy">Your Bot Army</Link>
          </li>
        </ul>
      </nav>
      <Routes>
        <Route path="/" element={<BotCollection />} />
        <Route path="/yourbotarmy" element={<YourBotArmy />} />
        <Route path="/bots/:id" element={<BotSpecs />} />
      </Routes>
    </Router>
  );
};

export default App;
